import styled from "styled-components";

export const Container = styled.div`
  width: 100%;
  height: 100%;
  float: left;
  padding-top: 10px;
`;

export const Tabs = styled.ul`
  width: 45%;
  display: block;
  float: left;
  height: 100%;
  margin: auto;
  // padding-right: 40px;
  // padding-left: 40px;
`;

export const TextTabs = styled(Tabs)`
  border: 2px dashed #2072d7b3;
  border-radius: 10px;
`;
